description:
Match of the Day 15.04.1989 Hillsborough Disaster

Whereas normally there would be highlights of the days football action, this programme talks about the disaster that took place earlier that day and includes initial reaction and speculation as to what caused the disaster. You can see the cover up starting to emerge.

